import React from 'react';

import './Portfolio.css';
import { Container, Row, Col, Carousel } from 'react-bootstrap';
import { Dialog, Toolbar } from '@material-ui/core';

import DarkContact from './DarkContact.js';
import ParkInn from './parkinn.png';
import ParkInn2 from './pls.png';

export default function Portfolio() {
    const [open, setOpen] = React.useState(false);    

    const handleClickOpen = () => {
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
    };

    return(
        <div>
            <div className="portfolio">
                <Container>
                    <Row>
                        <Col xs={12} sm={12} md={6} lg={6} className="pic-container">
                            <Carousel>
                                <Carousel.Item><img src={ParkInn} className="portfolio-pics" onClick={handleClickOpen} /></Carousel.Item>
                                <Carousel.Item><img src={ParkInn2} className="portfolio-pics" onClick={handleClickOpen} /></Carousel.Item>
                            </Carousel>
                            {/* <Dialog fullScreen open={open} onClose={handleClose}>
                                <Toolbar style={{ flexDirection:'row-reverse', marginBottom: '0px' }}>
                                    <i className="mat-icons close-icon" onClick={handleClose}>close</i>
                                </Toolbar>
                            </Dialog> */}
                        </Col>
                        <Col xs={12} sm={12} md={6} lg={6} className="project-container">
                            <h1 className="project-title">ParkInn</h1> <br/>
                            <h2 className="project-description">A parking reservation software to manage, monetize, and enforce parking reservations.</h2> <br />
                            <button>Learn More</button>
                        </Col>
                    </Row>
                </Container>
            </div>

            <DarkContact />
        </div>
    );
}
